import React from 'react';
import './App.css';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          TKC Class Schedule: First Class Scheduler
        </p>

        <iframe src="https://calendar.google.com/calendar/b/1/embed?height=600&amp;wkst=1&amp;bgcolor=%23ffffff&amp;ctz=America%2FNew_York&amp;src=cTN1NDcxbXZldXE2aDViazVxam50ZDlzNmNAZ3JvdXAuY2FsZW5kYXIuZ29vZ2xlLmNvbQ&amp;color=%23F4511E&amp;showTitle=0&amp;showDate=1&amp;showPrint=0&amp;showTabs=0&amp;mode=WEEK&amp;showCalendars=0&amp;showTz=0" style="border-width:0" width="800" height="600" frameborder="0" scrolling="no"></iframe>
      </header>
    </div>
  );
}

export default App;
